import React, { Fragment } from "react";
import WithSelect from "./container/withSelect";
import { environmentOptions } from "assets/selectableOptions";

const Header: React.FC = () => {
  return (
    <Fragment>
      <WithSelect name="Type" options={environmentOptions} />
      <WithSelect name="Environment" options={environmentOptions} />
    </Fragment>
  );
};

export default Header;
